/* Responda o seguinte: Para cada uma das declarações de viagem, informe quais ações ocorreram depois do registro de finalização da viagem, e quem foi o funcionário que executou essas ações. */
select e1.id, e1.resource from event_log AS e1 inner join event_log AS e2 on e1.idcase = e2.idcase  WHERE e2.activity = 'Fim da viagem' and e1.timestamp > e2.timestamp

/* Responda o seguinte: Quais declarações não foram finalizadas até 31 de março de 2018, tendo já tido o seu registro no sistema por meio da gravação da ação de início da viagem? */
SELECT idcase FROM event_log where activity = 'Início da viagem' INTERSECT SELECT idcase FROM event_log GROUP BY idcase  HAVING MAX(timestamp) >  '2018-03-31'

/* Responda o seguinte: Para cada declaração, quantas ações foram necessárias até que o fim da viagem fosse registrado? */
select count(*), e1.idcase from event_log AS e1 inner join event_log AS e2 on e1.idcase = e2.idcase WHERE e2.activity = 'Fim da viagem' and e1.timestamp < e2.timestamp group by e1.idcase

